import React, { createContext } from 'react';
import TodoList from './TodoList';
import CompA from './ComA';

const App = ()=>{
const FullName  = createContext();

    return (
        <>
        <FullName.Provider value = {'Shani Gaming'}>
        <CompA/>
        </FullName.Provider>
           <TodoList/>
        </>
    )
}


export default App;
